// submit.js

import { useState } from 'react';
import { useStore } from './store';
import { Button } from './components/ui/button';
import {
  Dialog,
  DialogContent,
  DialogHeader,
  DialogTitle,
  DialogDescription,
} from './components/ui/dialog';
import { CheckCircle2, XCircle, Loader2, Play, GitBranch, Boxes } from 'lucide-react';

export const SubmitButton = () => {
  const nodes = useStore((state) => state.nodes);
  const edges = useStore((state) => state.edges);
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [open, setOpen] = useState(false);

  const handleSubmit = async () => {
    setLoading(true);
    try {
      const response = await fetch('http://localhost:8000/pipelines/parse', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          nodes: nodes.map((n) => ({ id: n.id, type: n.type, data: n.data })),
          edges: edges.map((e) => ({ source: e.source, target: e.target })),
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to analyze pipeline');
      }

      const data = await response.json();
      setResult(data);
      setOpen(true);
    } catch (error) {
      setResult({ error: 'Failed to analyze pipeline. Make sure the backend is running on port 8000.' });
      setOpen(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <Button 
        onClick={handleSubmit} 
        disabled={loading}
        className="gap-2 bg-gradient-to-r from-violet-600 to-indigo-600 hover:from-violet-700 hover:to-indigo-700 shadow-md hover:shadow-lg transition-all duration-200"
      >
        {loading ? (
          <Loader2 className="w-4 h-4 animate-spin" />
        ) : (
          <Play className="w-4 h-4" />
        )}
        {loading ? 'Analyzing...' : 'Run Pipeline'}
      </Button>

      <Dialog open={open} onOpenChange={setOpen}>
        <DialogContent className="sm:max-w-md">
          <DialogHeader>
            <DialogTitle className="flex items-center gap-2 text-lg">
              {result && !result.error ? (
                <>
                  <div className="flex items-center justify-center w-8 h-8 rounded-full bg-emerald-100">
                    <CheckCircle2 className="w-5 h-5 text-emerald-600" />
                  </div>
                  Pipeline Analysis Complete
                </>
              ) : (
                <>
                  <div className="flex items-center justify-center w-8 h-8 rounded-full bg-red-100">
                    <XCircle className="w-5 h-5 text-red-600" />
                  </div>
                  Analysis Failed
                </>
              )}
            </DialogTitle>
            <DialogDescription className="text-gray-500">
              {result && !result.error
                ? 'Your pipeline has been validated successfully.'
                : 'There was an error analyzing your pipeline.'}
            </DialogDescription>
          </DialogHeader>

          {result && !result.error && (
            <div className="grid grid-cols-3 gap-3 py-4">
              <div className="flex flex-col items-center p-4 bg-gradient-to-br from-blue-50 to-blue-100/50 rounded-xl border border-blue-100">
                <Boxes className="w-5 h-5 text-blue-500 mb-2" />
                <div className="text-2xl font-bold text-blue-700">
                  {result.num_nodes}
                </div>
                <div className="text-xs font-medium text-blue-600/70">Nodes</div>
              </div>
              <div className="flex flex-col items-center p-4 bg-gradient-to-br from-violet-50 to-violet-100/50 rounded-xl border border-violet-100">
                <GitBranch className="w-5 h-5 text-violet-500 mb-2" />
                <div className="text-2xl font-bold text-violet-700">
                  {result.num_edges}
                </div>
                <div className="text-xs font-medium text-violet-600/70">Edges</div>
              </div>
              <div className={`flex flex-col items-center p-4 rounded-xl border ${
                result.is_dag 
                  ? 'bg-gradient-to-br from-emerald-50 to-emerald-100/50 border-emerald-100' 
                  : 'bg-gradient-to-br from-red-50 to-red-100/50 border-red-100'
              }`}>
                {result.is_dag ? (
                  <CheckCircle2 className="w-5 h-5 text-emerald-500 mb-2" />
                ) : (
                  <XCircle className="w-5 h-5 text-red-500 mb-2" />
                )}
                <div className={`text-2xl font-bold ${result.is_dag ? 'text-emerald-700' : 'text-red-700'}`}>
                  {result.is_dag ? 'Yes' : 'No'}
                </div>
                <div className={`text-xs font-medium ${result.is_dag ? 'text-emerald-600/70' : 'text-red-600/70'}`}>
                  Valid DAG
                </div>
              </div>
            </div>
          )}

          {result?.error && (
            <div className="p-4 bg-red-50 rounded-xl border border-red-100">
              <p className="text-sm text-red-600">{result.error}</p>
            </div>
          )}

          <div className="flex justify-end pt-2">
            <Button variant="outline" onClick={() => setOpen(false)}>
              Close
            </Button>
          </div>
        </DialogContent>
      </Dialog>
    </>
  );
};
